    true,nt"url": null,nt"notes": "Digital Audio Legal Recorder (DALR1), fac
    code CCB0, has up to 48 channels using two 24-channel audio interface boards.  The
    DALR1 rack includes:  GPS converter, printer, KVM switch, workstation, recorder
    logger, and an optional UPS.  Various supporting components include a remote alarm
    relay unit, temperature sensor, and network routers complete the system main components.
    The existing GPS recorder receiver and remote alarm unit will interface to the DALR1
    system. Each rack of equipment is equivalent to one unit. (Source: FSEP Desk Guide)",nt"license_title":
